typedef struct {
	int  val;
	int  dummy;
} elem_t;

int func_cmp(void *left, void *right)
{
	elem_t *el = (elem_t *)left;
	elem_t *er = (elem_t *)right;

	return el->val < er->val;
}

void func_test(void)
{
	int i;
	int n[RNUM] = {0};

	for (i = 0 ; i < RNUM; i++) {
		n[nums[i]]++;
	}

	heap_t *heap = heap_init(RNUM, func_cmp);

	for (i = 0; i < RNUM; i++) {
		elem_t *elem = calloc(1, sizeof(elem_t));
		elem->val = nums[i];
		assert(heap_push(heap, elem) == 0);
	}

	for (i = 0; i < RNUM; i++) {
		if (n[i]) {
			break;
		}
	}

	int k = i;
	elem_t *elem;
	for (i = 0; i < RNUM; i++) {
		elem = (elem_t *)heap_pop(heap);
		assert(elem != NULL && elem->val == k);
		if (--n[k] == 0) {
			k++;
		}

		while (!n[k]) {
			k++;
		}
	}

	heap_destroy(heap);

	printf("functional test passed\n");
}

int main(int argc, char const *argv[])
{
	func_test();
	return 0;
}



